import { getDoc, query } from "firebase/firestore";
import React, { useState } from "react";
query
const Hero = () => {
  const [bloodGroup, setBloodGroup] = useState("");
  const [city, setCity] = useState("");
  const [donors, setDonors] = useState([]);
  const [loading, setLoading] = useState(false);

  const handleSearch = async () => {
    if (!bloodGroup || !city) {
      alert("Please select both blood group and city.");
      return;
    }

    setLoading(true);

    try {
      const q = query(
        donorsCollection,
        where("BloodGroup", "==", bloodGroup),
        where("City", "==", city)
      );
      const querySnapshot = await getDocs(q);

      if (querySnapshot.empty) {
        alert("No donors found matching your criteria.");
      } else {
        const donorsList = querySnapshot.docs.map((doc) => doc.data());
        setDonors(donorsList);
      }
    } catch (error) {
      console.error("Error fetching donors: ", error);
      alert("Failed to search for donors.");
    } finally {
      setLoading(false);
    }
  };

  return (
    <div>
      <h2>Find Donor</h2>
      <div>
        <label>Blood Group:</label>
        <select value={bloodGroup} onChange={(e) => setBloodGroup(e.target.value)} required>
          <option value="">Select Blood Group</option>
          <option value="A+">A+</option>
          <option value="A-">A-</option>
          <option value="B+">B+</option>
          <option value="B-">B-</option>
          <option value="AB+">AB+</option>
          <option value="AB-">AB-</option>
          <option value="O+">O+</option>
          <option value="O-">O-</option>
        </select>
      </div>
      <div>
        <label>City:</label>
        <input
          type="text"
          value={city}
          onChange={(e) => setCity(e.target.value)}
          required
        />
      </div>
      <button onClick={handleSearch}>Find Donor</button>

      {loading && <p>Searching for donors...</p>}

      {donors.length > 0 && (
        <div>
          <h3>Donors Found:</h3>
          {donors.map((donor, index) => (
            <div key={index}>
              <h4>{donor.Name}</h4>
              <p>Contact: {donor.ContactNumber}</p>
              <p>Blood Group: {donor.BloodGroup}</p>
              <p>City: {donor.City}</p>
            </div>
          ))}
        </div>
      )}
    </div>
  );
};



export default Hero;
